import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
    footerBlock: {
        backgroundColor: '#5656ef',
        position: 'absolute',
        bottom: 0,
        width: '100%',
        height: 75
    }
})

export default useStyles
